    <a
      className={"flex gap-1 font-semibold underline my-3 block"}
      target="_blank"
      href={"https://maps.google.com/?q=" + children}
    >
      <svg
        xmlns="http://www.w3.org/2000/svg"
        fill="none"
        viewBox="0 0 24 24"
        strokeWidth={1.5}
        stroke="currentColor"
        className="w-6 h-6"
